import React from "react";

const Banner = () => {
  return (
    <div className="px-20 py-10">
      <div className="py-10">
        <div className="text-teal-400 w-full text-6xl justify-center text-center top-1/2 font-sans font-bold ">
          <h1>WALLPAPERHUB</h1>
          <p className="text-2xl text-yellow-50 py-10">
            One Stop for Awesome Wallpapers
          </p>
        </div>
      </div>
    </div>
  );
};

export default Banner;
